import React from 'react';
import s from './Profil.module.css';
import MyPosts from './MyPosts/MyPosts';
import ProfilInfo from './ProfilInfo/ProfilInfo';
import {ActionsTypes, ProfilPageType, StoreType} from "../../Redux/State";

type PropsType = {
    profilPage: ProfilPageType
    dispatch: (action: ActionsTypes) => void

}
const Profil = (props: PropsType) => {
    return (
        <div className={s.content}>
            <ProfilInfo/>
            <MyPosts
                posts={props.profilPage.posts}
                newPostText={props.profilPage.newPostText}
                dispatch={props.dispatch}/>
        </div>
    )
}

export default Profil;
